{'_content': 'At The La Brea Tar Pits. 

From Wikipedia:
The La Brea Tar Pits are a group of tar pits around which Hancock Park was formed in urban Los Angeles. Natural asphalt (also called asphaltum, bitumen, pitch or tar—brea in Spanish) has seeped up from the ground in this area for tens of thousands of years. The tar is often covered with dust, leaves, or water. Over many centuries, the bones of animals that were trapped in the tar were preserved. The George C. Page Museum is dedicated to researching the tar pits and displaying specimens from the animals that died there. The La Brea Tar Pits is a registered National Natural Landmark.'}

{'_content': 'The La Brea Tar Pits are a group of tar pits around which Hancock Park was formed in urban Los Angeles. Natural asphalt (also called asphaltum, bitumen, pitch or tar—brea in Spanish) has seeped up from the ground in this area for tens of thousands of years. The tar is often covered with dust, leaves, or water. Over many centuries, the bones of animals that were trapped in the tar were preserved. The George C. Page Museum is dedicated to researching the tar pits and displaying specimens from the animals that died there. The La Brea Tar Pits is a registered National Natural Landmark.

The modern name is an example of a tautological place name; &quot;the La Brea Tar Pits&quot; literally means &quot;the the tar tar pits.&quot;
599'}

{'_content': 'The Italianate style home was designed for Sanson M. Cooper as his personal residence in 1917.  The actual architect was likely a draftsman in Cooper's office; Robert D. Jones, who would collaborate as architect with Cooper on many Windsor Square projects, had yet to join the firm. 

Sanson M. Cooper, who was trained as a minister at Bethany College in West Virginia, had come to Los Angeles from Cincinnati in about 1912, bringing with him artisans and crew.Cooper died while still living at the house on May 19, 1935.  In his obituary, the Los Angeles Times referred to him as  &quot;Rev. Sanson Milligan Cooper,&quot; the &quot;pioneer builder&quot; was &quot;credited with building hundreds of homes in Windsor Square, the Wilshire District, Beverly Hills and San Marino.&quot; 

After her husband's death, Ella Cooper moved to 157 North Gower Street; the house was later occupied by screenwriter Sam Mintz (Tom Sawyer with Jackie Coogan, 1930, and Anne of Green Gables with Anne Shirley, 1934). Despondent over ill health, Mintz slashed his wrists and throat in a bathroom at the house on May 4, 1937.(he survived).  Source:  <a href="http://windsorsquarelosangeles.blogspot.com" rel="noreferrer nofollow">windsorsquarelosangeles.blogspot.com</a>

The Sanson M. Cooper House is located at 435 South Lorraine Boulevard in the historic Windsor Square neighborhood of Los Angeles, California.  Please do not use this image in any media without my permission. © All rights reserved.'}

{'_content': 'Architect Thornton Fitzhugh designed the Tudor Craftsman style residence for Thomas H. Murphy in 1917.  Fitzhugh was born in Indianapolis, Indiana on May 18, 1864.  He was married twice; to Anne (1868-1909) and Mabel (1885-1964).  He died in Los Angeles on December 4, 1933 and is interred at Evergreen Cemetery.

The Thomas H. Murphy Residence is located at 356 South Lorraine Boulevard in the historic Hancock Park neighborhood of Los Angeles, California.  Please do not use this image in any media without my permission. © All rights reserved.

'}

{'_content': 'Architects Hudson &amp; Munsell designed the Mediterranean Revival style house for Louis Simon Nordlinger in 1928.  Nordlinger was born in California on June 21, 1875.  He worked in his father Simon's jewelry store before striking out on his own in the 1930s, when he worked as an &quot;adviser&quot; in a stationery store.  He lived in the house with his wife Fannie.  Nordlinger was still living at the house when he died on June 8, 1940

The house was reported by the Los Angeles Times of December 22, 1940 as sold to Erle Barker, vice president of Barker Brothers, the Los Angeles furniture company founded in 1880 by his grandfather. Barker's stay was brief; the house was being offered in classified advertisements in late 1946 as being for sale at a &quot;sacrifice,&quot; with immediate possession available (Barker was in ill health; after a move to Los Feliz, he died in a Santa Monica hospital on January 22, 1948). Source:  <a href="http://windsorsquarelosangeles.blogspot.com" rel="noreferrer nofollow">windsorsquarelosangeles.blogspot.com</a>

The Nordlinger House is located at 515 South Lorraine Boulevard in the historic Hancock Park neighborhood of Los Angeles, California.  Please do not use this image in any media without my permission. © All rights reserved.'}

{'_content': 'Architect Robert D. Jones designed the English Tudor Revival style house for George Alexander. McNee in 1926. McNee was born in Wisconsin on February 26, 1882.  He was President of McNee Oil Company in Torrance, California.  He lived in the house with his wife Myrtle and their two children, Maureen and George C. McNee.  He died on October 9, 1962.  The house is located at 125 South Las Palmas Avenue in the historic Hancock Park neighborhood of Los Angeles, California.  

Please do not use this image in any media without my permission. © All rights reserved.
'}

