{'_content': 'Walter F. Olerich was an older brother of Charles Olerich, both of whom were highly successful building contractors in the Los Angeles area in the 1920s.  Walter more than likely designed the English Tudor Revival style house as a speculative venture.  At the time he was living in the vicinity at 508 North June Street with his wife Florence.  He began his career in Los Angeles working as a carpenter in the motion picture industry.

The house is located in the historic Hancock Park neighborhood of Los Angeles, California.  Please do not use this image in any media without my permission. © All rights reserved.
'}

{'_content': 'Architect Gordon B. Kaufmann designed the Mediterranean Revival style house for attorney Louis M. Lissner in 1925.  Lissner lived in the house with his wife Marion and their two daughters Barbara and Gertrude.  Located at 505 South Hudson Avenue in the historic Hancock Park neighborhood of Los Angeles, California.

Please do not use this image in any media without my permission. © All rights reserved.

'}

{'_content': "Architect George Olerich (1897-1982) designed the English Tudor Revival style house for real estate broker Harold Vorce in 1926. Olerich, whose occupation was also listed as &quot;actor in silent films&quot; was one of seven children of Antone and Mary Olerich.  His older brother, Walter designed the Moorish style Villa Fez for film director Rupert Hughes, the brother of Howard Hughes (1925 in Los Feliz)..

The 5-bedroom, 6-bath home in 6469 sq. ft. is currently (November 2016) on the market listed for sale for $6,350,000 and described in the listing as &quot;Rare and restored 1920's English tennis court estate set on a lush half acre lot and surrounded by mature landscaping; pool/spa, pool house and elevator. Tastefully re-imagined by June Street Architects and celebrity designer Carrie Livingston, this one of a kind English Manor combines modern luxury living with old world charm and character. Grand foyer with sweeping staircase, original stained glass skylight, formal dining area with detailed crown moldings and wainscotting, library,  entertainment bar, maids suite and laundry room off kitchen. A true once in a generation property&quot;.

Located at 647 South June Street in the historic Hancock Park neighborhood of Los Angeles, California.  Please do not use this image in any media without my permission. © All rights reserved."}

