{'_content': "Bo Shi Architects designed the contemporary style house for Joseph Hasenfeld in 2016.  The 3-bedroom, 6-bath home is currently (November 2016) on the market listed for sale for $3,790,000 and described in the listing as &quot;Not just another box house, but truly a fabulous, warm and nurturing home that pushes the envelope of what is a modern contemporary design, high end quality materials and professional execution. On entry one feels awed by the soaring ceilings and the expansiveness of the fantastic Great Room. The chefs' kitchen designed with earth tone Scavolini cabinets, Miele appliances and two stainless sinks and what every home should have a floor to ceiling temperature controlled wine cellar The back yard with a cabana, pool and spa is everything one should expect in a 5 star resort. The home is 5Br and 5.5Ba. The ample master suite has a phenomenal walk-in closet. The crowning glory of this home is its roof top patio. With a spa and a relaxing canopy of greenbelt views. You work hard day in and day out but your reward is going home to your very own 5 Star getaway on a very residential tree lined street in the heart of the city&quot;.

Please do not use this image in any media without my permission. © All rights reserved.
"}

