{'_content': "Nearly 20 years ago, I lived in western Hollywood (as distinct from West Hollywood) and spent many mornings running the streets and paths through the Hollywood Hills.  One of the Hills’ most extraordinary locations is Solar Drive, which overlooks the park at Runyon Canyon and has pretty spectacular views from downtown Los Angeles all the way to the Pacific Ocean.  At the end of Solar Drive, construction started back then on a huge mansion which, I’ve heard, has living space of nearly 10,000 square feet.  

And not a square foot has ever been occupied.  Construction was never completed, and no owner has ever lived here.  Apparently, it has been used by squatters, and has been the scene of [unauthorized] parties and, rumor says, satanic rituals.  Many windows are broken and many others boarded up.  In the courtyard sits a substantial motorcoach, occupied by a security guard, and there are dogs patrolling the walled portion of the hilltop property.

I had hoped to catch Hill House looking grim and sepulchral at sunset (something like Xanadu from &quot;Citizen Kane&quot;) but, with it's fairly smooth pink facade, the cracks just slightly visible, it seems less Gothic than simply a metaphor for the way everything ages in Hollywood... sadly.

In architecture, the word “folly” refers to &quot;a whimsical or extravagant structure built to serve as a conversation piece, lend interest to a view, commemorate a person or event, etc.&quot;
"}

