{'_content': "Harlan's Ground Sloth
Glossotherium harlani

This medium-sized ground sloth stood a little over six feet tall and weighed about 1500 pounds. Its simple, flat, grinding teeth indicate that it probably preferred a diet of grass, although it may have also fed on tubers, bushes, and trees. Ground sloths are primitive animals, related to the present-day armadillos and the small tree sloths of Central and South America."}

